import React from 'react';
import "./footer.css";
//import "../bootstrap.css";

export default function Footer() {
    return (
        <footer>
            <div className="container" id='footer-text'>
                <div id="footer-top">Lorem Ipsum</div>
                <div id="adres">
                    <p>Lorem:</p><p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Deserunt?</p>
                </div>
                <div id="tel">
                    <p>Lorem, ipsum.:</p><p>Lorem ipsum dolor sit.</p>
                </div>
                <div id="social-media">
                        <a href="https://www.instagram.com/airbornerocket/" target="_blank"><i className="fa-brands fa-instagram"></i></a>
                        <a href="#"><i className="fa-brands fa-twitter"></i></a>
                        <a href="https://www.linkedin.com/company/airborneroket" target="_blank"><i className="fa-brands fa-linkedin"></i></a>
                </div>
                <br />
                <hr />
                <br />
                <div id='footer-bottom'>
                    <div id="copyright">© 2022 Lorem, ipsum dolor.</div>
                    <div className='language'><a href='#'>English</a></div>
                </div>
            </div>
        </footer>
    );
}
